import React from "react";
import './item.css';

const Item=()=>{
    return(
        <div className="item">
            <img src={props.image} alt=""></img>
            <p>{props.image}</p>
            <div className="item-prices">
                <div className="item-price-new">
                {props.new_price}
                </div>
                <div className="item-price-old">
                {props.old_price}
                </div>
            </div>

        </div>
    )
}
export default Item;
